import React from 'react';

const Footer = () => {
  return (
    <footer style={{
      backgroundColor: '#2c3e50',
      color: 'white',
      padding: '1.5rem 0',
      textAlign: 'center',
      marginTop: '2rem'
    }}>
      <div className="container">
        <p>Đồ án nghiên cứu phát hiện Deepfake Video - © 2024</p>
        <p>Phát triển bởi: Nguyễn Văn A</p>
      </div>
    </footer>
  );
};

export default Footer;
